    @Test
    public void testActivationCheck() throws ParseException {
        String activationCode = ActiveCode.activeCodeCheck("LSJW26G99DS053493","89860112623100360500","0B884A612A591C0D","00D2580003");
        DateFormat dateFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
        Date beginDate = dateFormat.parse("2012-01-01 00:00:00");
        Date endDate = new Date();
        long millisecond = endDate.getTime() - (beginDate.getTime() + Calendar.getInstance().getTimeZone().getRawOffset());
        int day = (int)(millisecond/24L/60L/60L/1000L);
        int result = ActiveCodeHandler.checkActiveCode(activationCode,"LSJW26G99DS053493","89860112623100360500","0B884A612A591C0D","00D2580003",day);
        System.out.println(result);


    }
